import React from "react"
class TodoList extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            items: []
        }
    }
    render() {

        return (

            <div>
                <ul className="list-group">
                    {this.props.tasks.map((task) => {
                        return <li className="list-group-item">{task.item}
                            <button className="btn btn-danger" style={{marginLeft:100 +'px'}} onClick={this.props.deleteTask.bind(this,task.id)}>Delete</button>
                            <button className="btn btn-success">Mark Completed</button>
                        </li>

                    })}

                </ul>
            </div>
        )
    }
}
export default TodoList
